import React from 'react'
import { Row, Col } from 'antd';
import './index.scss'
class Home extends React.Component{
    render(){
        return (
            <Row id='header'>
            <Col className='logo' span={24}>美丽湾</Col>
            <a href="catalog.php" class="top_bt"></a>
            <a href="flow.php" class="user_btn"></a>

          </Row>)
    }
}

export default Home;
